package collection;
import java.util.HashSet;

public class HashSets {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		HashSet hs=new HashSet();
		hs.add("A");
		hs.add("B");
		hs.add("C");
		hs.add("R");
		hs.add("20");
      System.out.println(hs);
	}

}
//output:[A, B, R, C, 20]
